CREATE DEFINER=`root`@`localhost` PROCEDURE `add_new_app`( device_name varchar(50),app_name varchar(30),description text)
BEGIN
declare counter int;

select count(*) into counter from infra.applications where name = app_name;

if counter > 0 then
select 'false' as success,'app exists already' as message;
else


select count(*) into counter from infra.devices where name = device_name;

if counter = 0 then

