CREATE DEFINER=`root`@`localhost` PROCEDURE `filter_update`( device_name varchar(50),app_name varchar(100),checked varchar(10),name varchar(100),value varchar(100),return_limit int(11))
BEGIN

declare counter int(11);
declare device_id int(11);
declare app_id int(11);
declare table_id int(11);

DECLARE EXIT HANDLER FOR SQLEXCEPTION
BEGIN

call activeTrack( device_name,app_name,'',name, value,'filter_update');

GET DIAGNOSTICS CONDITION 1
@p1 = RETURNED_SQLSTATE, @p2 = MESSAGE_TEXT;
SELECT  'false' as success  , @p2 as message,@p1 as RETURNED_SQLSTATE,'filter_update ' proc_name;
ROLLBACK;
END;
call infra.log('start filter_update ');
call infra.log(device_name );
call infra.log(app_name);
call infra.log(checked);
call infra.log(name );
call infra.log(value );
set counter = 0;
set device_id = 0;


if name is null or name =" or value is null or value=" then
select 'false' success,' empthy input filter_update' message;
end if;

select count(*) into counter from infra.devices as d where d.name like device_name ;

if counter < 1 then
select 'false' as success,'the deivce not exists 1' as message,counter ;
else
set counter = 0;
select count(*) into counter from infra.applications as a where a.name like  app_name  ;
if counter < 1 then
select 'false' as success,'the app not exists 1' as message,counter ;
else
select a.id into app_id from infra.applications a where a.name like  app_name  ;
select t.id into table_id from infra.tables t where t.app_id = app_id ;
select id into device_id from infra.devices d where d.name = device_name;


call infra.log('start work');
if name='ALL'and value='ALL' then
 delete  from infra.filters   where device_id  = device_id and application = app_name ;
else
if checked ='false' then
call infra.log('start delete');
delete  from infra.filters   where device_id  = device_id and application = app_name  and field= name and data=value;
call infra.log('end delete');
else
select count(*) into counter from infra.filters as f where f.device_id  = device_id and f.application = app_name  and f.field= name and f.data=value;
call infra.log('counter');
call infra.log(counter);
if counter < 1 then
call infra.log('after insert into filter');
insert into infra.filters (device_id  ,application ,data,field) values (device_id  ,app_name  ,value,name );

call infra.log('after insert filters');
end if;
end if;
end if;



call infra.log('finish >>>>infra.filter_update');
call infra.search(device_name,app_name,return_limit ,0);


end if;
end if;
END ;;
