CREATE DEFINER=`root`@`localhost` PROCEDURE `getFilter`( device_name varchar(30),app_name varchar(50),limit_rows int(11))
BEGIN
declare counter int(11);
declare device_id int(11);
declare table_id int(11);
declare app_id int(11);

declare tbl_name varchar(50);
DECLARE done TINYINT DEFAULT FALSE;
DECLARE var1 varchar(50) ;
DECLARE statement varchar(5000) ;
DECLARE statement1 varchar(5000) ;
DECLARE statement2 varchar(5000) ;
DECLARE cursor1 -- cursor1 
 CURSOR FOR
 SELECT name FROM infra.fields flds WHERE flds.application = app_name and flds.can_filter=1  and flds.is_active=1; 
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
DECLARE EXIT HANDLER FOR SQLEXCEPTION
BEGIN
call activeTrack( device_name,app_name,'','', '','getFilter');

GET DIAGNOSTICS CONDITION 1
@p1 = RETURNED_SQLSTATE, @p2 = MESSAGE_TEXT;
SELECT  'false' as success  , @p2 as message,@p1 as RETURNED_SQLSTATE,'state_update' proc_name;
ROLLBACK;
END;

set counter = 0;
/*handle filter*/
OPEN cursor1;
 my_loop: LOOP
 FETCH cursor1 INTO var1;
IF done THEN
   LEAVE my_loop;
ELSE 

if statement ='' or statement  is null then
set statement =concat( ' (select ''',var1,''' as field ,',var1 ,' as data ,',' count(*) as count from devices_data.',app_name,' group by ',var1,' having (data is not null AND data !="" ) order by count desc  limit ',limit_rows ,')');
else
set statement =concat(statement , ' UNION All (select ''',var1,''' as field ,',var1 ,' as data ,',' count(*) as count from devices_data.',app_name,' group by ',var1,' having (data is not null AND data !="" ) order by count desc  limit ',limit_rows ,')');
end if;
end if;
 END LOOP;
CLOSE cursor1;
call infra.log(statement );
/*handle selected filter*/


select a.id into app_id from infra.applications a where a.name like  app_name  ;
select t.id into table_id from infra.tables t where t.app_id = app_id ;
select id into device_id from infra.devices d where d.name = device_name;
select count(*) into counter from infra.device_state as d where d.device_id  = device_id  ;
if counter < 1 then
	insert into infra.device_state (device_id  ,table_id) values (device_id  ,table_id);
	set  statement1 = 'select null from tables';
	set  statement2 = 'select null from tables';
else
	set statement1 =concat( 'select f.data,f.field from infra.filters as f where f.device_id  = ',device_id,' and f.application = ''',app_name,'''');
	/*set statement2 =concat( 'select f.name,f.label from infra.fields as f where f.application  = '',app_name,'' and f.can_sort=1'); im not sure why this statment*/
    	set statement2 =concat( 'select f.name,f.label from infra.fields as f where f.application  = ''',app_name,''' and f.can_filter=1 and is_active=1');
end if;

call infra.log('start stament');
call infra.log(statement);
call infra.log(statement1);
call infra.log(statement2);
SET @sql:=statement ;
SET @sql1:=statement1 ;
SET @sql2:=statement2 ;
PREPARE dynamic_statement FROM @sql;
PREPARE dynamic_statement1 FROM @sql1;
PREPARE dynamic_statement2 FROM @sql2;

EXECUTE dynamic_statement;
EXECUTE dynamic_statement1;
EXECUTE dynamic_statement2;
DEALLOCATE PREPARE dynamic_statement;
DEALLOCATE PREPARE dynamic_statement1;
DEALLOCATE PREPARE dynamic_statement2;

END ;;
DELIMITER ;
