CREATE DEFINER=`root`@`localhost` PROCEDURE `search`( device_name varchar(100),app_name varchar(100),return_limit int,return_offset int)
BEGIN
declare counter int(11);
declare device_id1 int(11);
declare table_id int(11);
declare tbl_name varchar(100);
declare sort_by varchar(4000);
declare  search varchar(4000);
declare  activefields varchar(4000);
declare  search_part varchar(5000);
declare filter_flag  int(11);
DECLARE done TINYINT DEFAULT FALSE;
DECLARE var1 varchar(100) ;
DECLARE varitem varchar(100) ;
DECLARE varfield varchar(100) ;
DECLARE prevfield varchar(100) ;
DECLARE varActive varchar(100) ;

DECLARE cursor1 -- cursor1 to get searched fields
 CURSOR FOR
 SELECT name FROM infra.fields flds WHERE flds.application = app_name and flds.can_search=1 and flds.is_active=1; 
DECLARE cursor2 -- cursor2 to get filters
 CURSOR FOR
SELECT field ,concat(field ,'=''',data,'''') as item FROM infra.filters where device_id=device_id1  and application=app_name order by field; 
DECLARE cursor3 -- select only is_active
 CURSOR FOR
 SELECT name FROM infra.fields flds WHERE flds.application = app_name and flds.is_active=1; 
  /*SELECT name FROM infra.fields flds WHERE flds.application = app_name and   flds.is_active=1;
 SELECT field ,concat(field ,'=''',data,'''') as item FROM infra.filters where device_id=device_id and application=app_name order by field; 
*/

DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;



DECLARE EXIT HANDLER FOR SQLEXCEPTION
BEGIN
GET DIAGNOSTICS CONDITION 1
@p1 = RETURNED_SQLSTATE, @p2 = MESSAGE_TEXT;
SELECT  'false' as success  , @p2 as message,@p1 as RETURNED_SQLSTATE,'state_update' proc_name;
ROLLBACK;
END;
call infra.log('start');
call infra.log('cursor2');

set sort_by = '';
set counter = 0;
if return_limit ='' or return_limit is null then
 set return_limit =20;
end if;
if return_offset='' or return_offset is null then
 set return_offset=0;
end if;

select count(*) into counter from infra.devices where name like device_name ;
if counter != 1 then 
select 'false' as success , 'device not exists' as message,device_id  as counter;
else
select id into device_id1  from infra.devices where name like device_name ;
set counter = 0;
select count(*) into counter from infra.device_state as ds where ds.device_id = device_id1  ;

if counter != 1 then 
select 'false' as success , 'state not exists' as message,counter as counter;
else
 select ds.table_id  into table_id  from infra.device_state as ds where ds.device_id = device_id1  ;
 set counter = 0;
 select count(*) into counter from infra.tables where id = table_id ;
if counter != 1 then 
 select 'false' as success , 'table not exists' as message,counter as counter;
else



select order_by into sort_by from infra.device_state dv where dv.table_id = table_id and dv.device_id = device_id1 ;
if sort_by is null or sort_by='' then
 set sort_by = '';
else
   set sort_by = CONCAT(' order by ',sort_by,'');
end if;
call infra.log('=sort_by');
call infra.log(sort_by);
/*Handle search with cursor1*/
select search_value into search from infra.device_state dv where dv.table_id = table_id and dv.device_id = device_id1 ;
/*call infra.log('=search');*/
/*call infra.log(search);*/
if search is null or search ='' then
 set search_part = '';
else
set filter_flag =0;
/*call infra.log('start loop');*/
OPEN cursor1;
 my_loop: LOOP

 FETCH cursor1 INTO var1;
  IF done THEN
   LEAVE my_loop;
    ELSE

    if search_part is null or search_part ='' then 
           set search_part = concat(' where (',var1,' LIKE "%',search,'%"');
   else
          set search_part = CONCAT(search_part ,' or ',var1,' LIKE "%',search,'%"');
  end if;
  END IF;
 END LOOP;
 if search_part is not null and search_part !='' then
     set search_part = concat(search_part ,' )');
end if;
CLOSE cursor1;
end if;
call infra.log('finish cursor1 search_part:');
call infra.log(search_part);

set done = FALSE;

OPEN cursor3;
 search_loop: LOOP
 FETCH cursor3 INTO varActive;
  IF done THEN
   LEAVE search_loop;
    ELSE
    if activefields is null or activefields ='' then 
           set activefields = CONCAT('tbl.',varActive);
   else
          set activefields = CONCAT(activefields ,' , tbl.',varActive);
  end if;
  END IF;
 END LOOP;
CLOSE cursor3;

call infra.log('finish cursor3 activefields:');
call infra.log(activefields);


/*call infra.log('close cursor');*/
