CREATE DEFINER=`root`@`localhost` PROCEDURE `security`( device_name varchar(100),app_name varchar(100),function_name varchar(100))
BEGIN

declare counter int;
declare deviceid  int;
declare app_id  int;
declare roleId int;
declare userId  int;
declare is_logged int;
declare functionid int;
declare table_id int(11);


DECLARE done TINYINT DEFAULT FALSE;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
DECLARE EXIT HANDLER FOR SQLEXCEPTION

BEGIN
GET DIAGNOSTICS CONDITION 1
@p1 = RETURNED_SQLSTATE, @p2 = MESSAGE_TEXT;
SELECT 
    'false' as success,
    @p2 as message,
    @p1 as RETURNED_SQLSTATE,
    'state_update' proc_name;
ROLLBACK;
END;
call infra.log('start security');
call infra.log(concat('device_name :',device_name,' app_name :',app_name ,' function_name:',function_name  ) );

call activeTrack( device_name,app_name,'function_name','',function_name, 'security');

select  id into roleId from infra.roles where name = 'freeuser';
set is_logged =0;
set counter = 0;
set deviceid = 0;

            
            
select   count(*) into counter from  infra.devices as d where  d.name like device_name;
if counter < 1 then
	call infra.log('the deivce not exists');
	select 'false' as success,  'the deivce not exists ' as message,counter;
else
	select  id into deviceid from infra.devices d where  d.name = device_name;
	call infra.log(concat('deviceid :',deviceid  ) );
	select  count(*) into counter from infra.applications as a where a.name like app_name;
	call infra.log(concat('counter app_name  :',counter  ) );
	if counter < 1 then
		call infra.log('the app not exists');
		select 'false' as success,  'the app not exists ' as message,counter;
	else
		select a.id into app_id from infra.applications a where a.name like  app_name  ;
		call infra.log(concat('app_id  :',app_id ) );
		set counter = 0;
		select count(*)into counter from infra.tables t where t.app_id = app_id;
		call infra.log(concat('counter app_id  at tables :',counter ) );
		if counter < 1 then
			call infra.log('the table not exists');
			select   'false' as success,    'the table not exists ' as message,  counter;
		else
			/*set counter = 0;
			select count(*)into counter from infra.user_devices where  device_id = deviceid;
			call infra.log(concat('counter user_devices  :',counter ) );*/
            
		/* set initial state for first entarance to system, to new user*/
			select count(*) into counter from infra.device_state as d where d.device_id  = device_id  ;
			if counter < 1 then
			
				select t.id into table_id from infra.tables t where t.app_id = app_id ;
				insert into infra.device_state (device_id  ,table_id) values (device_id  ,table_id);
			end if; 
            
            set counter = 0;
			select count(*)into counter from infra.user_devices where  device_id = deviceid;
			call infra.log(concat('counter user_devices  :',counter ) );

			if counter >0 then
				select  user_id into userId from infra.user_devices where device_id = deviceid;
				call infra.log(concat('user_id  :',userId ) );
				select is_logged into is_logged from infra.user_devices where  device_id = deviceid;
				call infra.log(concat('is_logged :',is_logged ) );
				if is_logged =1 then 
					   select role_id into roleId from user_roles where user_id = userId and app_id=app_id;
				 end if;
             /*else if counter =0 then
               insert into infra.user_devices (user_id,device_id,created,is_logged) values(  userId,deviceid,Now(),0);
               */
			end if;
            end if;
			select  id into functionid from  functions where  name like function_name;
			call infra.log(concat('functionid :',functionid  ) );

            set counter=0;
			select   count(*) into counter from infra.role_functions where   function_id = functionid   and role_id = roleId and app_id=app_id;
			call infra.log(concat('counter from role_functions  functionid:',functionid,'  roleId:',roleId,'  app_id:',app_id,'  counter:',counter ) );
            

			if counter >0 then
			  call infra.log('select true success');
			  select 'true' as success;
			else
			  call infra.log('select false ,not in role_functions;');
			  select 'false' as success;
			end if;

		end if;
	end if;

END ;;
